import React from 'react'
import { Draggable } from 'react-beautiful-dnd'

function PanelElement({index, children}) {
  return (
    <Draggable draggableId={index}>
    {provider => (
      <div className='panel'
        
      >
          <div className="boxSelector"></div>
          {children}
      </div>
    )}
    </Draggable>
  )
}

export default PanelElement
